import './App.css';
import axios from 'axios';
import { useState,useEffect } from 'react';

const api = axios.create({
  baseURL:`http://localhost:3000/users`
})



function App() {

  const [users,setusers] = useState([])

  async function createCourse(){
    let res = await api.post('/',{id:5,first_name:'sagar',last_name:'chhatbar',email:'sagar@gmail.com'})
    console.log(res);
  }


  useEffect(()=>{
    api.get('/').then(res =>{
      console.log(res.data);
      setusers(res.data);
    })
  },[])

  return (
    <div className="App">

        <button onClick={createCourse}>create user</button>
        {users.map(todo => <h2 key={todo.id}>{todo.title}</h2>)}
    </div>
  );
}

export default App;
